<!DOCTYPE html>
<!-- Created with Adobe(R) technology -->
<html>
  <head>
    <meta charset="utf-8"></meta>
    <link href="precios.css" type="text/css" rel="stylesheet"></link>
    <script type="text/javascript" src="jquery-1.4.2.js"></script>
    <script type="text/javascript" src="precios.js"></script>
  </head>
  <body>
    <div class="wlby_movie">
      <div class="wlby_1">
        <!-- Start of symbol: BG -->
        <img src="precios_assets/BG.jpg" height="768px" width="1024px" class="wlby_2"></img>
        <!-- End of symbol: BG -->
      </div>
      <div class="wlby_3">
        <!-- Start of symbol: letrero -->
        <div class="wlby_4 wlby_sprite">
          <div class="wlby_5 wlby_fs">
            <!-- Shape with bitmap fill converted to shaped masked bitmap (to work around SVG nesting issues) -->
            <div class="wlby_6">
              <div class="wlby_7 wlby_masked">
                <div class="wlby_8 wlby_masked">
                  <div class="wlby_9 wlby_masked">
                    <!-- Div with repeating background-image to get tiled bitmap fill -->
                    <div class="wlby_10"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="wlby_11">
            <!-- Shape with bitmap fill converted to shaped masked bitmap (to work around SVG nesting issues) -->
            <div class="wlby_6">
              <div class="wlby_12 wlby_masked">
                <div class="wlby_13 wlby_masked">
                  <div class="wlby_9 wlby_masked">
                    <!-- Div with repeating background-image to get tiled bitmap fill -->
                    <div class="wlby_14"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <!-- End of symbol: letrero -->
      </div>
      <div class="wlby_15">
        <!-- Start of symbol: carritos -->
        <div class="wlby_16 wlby_sprite">
          <div class="wlby_17 wlby_fs"></div>
          <div class="wlby_18 wlby_fs">
            <!-- Start of symbol: verder -->
            <img src="precios_assets/svgblock_2.svg" class="wlby_19"></img>
            <!-- End of symbol: verder -->
          </div>
        </div>
        <div class="wlby_16 wlby_sprite">
          <div class="wlby_20 wlby_fs"></div>
          <div class="wlby_21 wlby_fs">
            <!-- Start of symbol: rojo -->
            <img src="precios_assets/caroRojo.png" height="888px" width="696px" class="wlby_22"></img>
            <!-- End of symbol: rojo -->
          </div>
        </div>
        <div class="wlby_16 wlby_sprite">
          <div class="wlby_23 wlby_fs">
            <!-- Start of symbol: amarillo -->
            <img src="precios_assets/carroAmarillo.png" height="804px" width="655px" class="wlby_24"></img>
            <!-- End of symbol: amarillo -->
          </div>
        </div>
        <!-- End of symbol: carritos -->
      </div>
      <div class="wlby_3">
        <!-- Start of symbol: precios -->
        <img src="precios_assets/precios.png" height="768px" width="1024px" class="wlby_2"></img>
        <!-- End of symbol: precios -->
      </div>
    </div>
  </body>
</html>
